import React from 'react';
import { View,StyleSheet} from 'react-native';
import { Divider, Flex, Box, Heading, Center,NativeBaseProvider,Text,Button } from "native-base";
import Tabs from '../components/Tabs';


const Principal  = ({navigation}) => {

return (
    <NativeBaseProvider>
        <Box alignItems="left">
            <Flex onPress={() => console.log("prueba de click")} backgroundColor ="#ffff" direction="row">

            <Button mx="2" variant="link" colorScheme="grey">
                Ingredientes
            </Button>

            <Button mx="2" variant="link" colorScheme="grey">
                Plato
            </Button> 

            <Button mx="2" variant="link" colorScheme="grey">
                Tipo
            </Button> 

             <Button mx="2" variant="link" colorScheme="grey">
                Usuario
            </Button> 


            </Flex>
        
        </Box>
        </NativeBaseProvider>
  );
};

const styles = StyleSheet.create({
    container: {
      flex: 1
    },
  });

export default Principal;
